import {
  Contacts,
  CookiesPolicy,
  Info,
  Teachers,
  What,
  Where,
} from "./components";
import Peculiarities from "./components/peculiarities";

const App = () => (
  <div className="w-screen bg-gray">
    <Info />
    <What />
    <Where />
    <Peculiarities />
    <Teachers />
    <Contacts />
    <CookiesPolicy />
  </div>
);

export default App;
